import React, { Component } from "react";

class SingleOrder extends Component {
	render() {
		return (
			<div>
				{this.props.buyOrdersArray.map((order) => {
					<p>{order.id}</p>;
				})}
			</div>
		);
	}
}
export default SingleOrder;
